package cn.pintia.zjo.practice.test.problem3609;import java.util.Arrays;import java.util.PriorityQueue;import java.util.Queue;public class PriorityQueueTest {    private Queue<Integer> queue = new PriorityQueue<>();    public PriorityQueueTest() {        queue.add(3);        queue.add(4);        queue.add(0);    }    public Comparable[] toArray() {        return queue.toArray(new Integer[queue.size()]);    }    public void printPoll() {        while(!queue.isEmpty()) {            System.out.println("Head Item: " + queue.poll());        }    }    public static void main(String[] args) {        PriorityQueueTest test = new PriorityQueueTest();        test.printPoll();    }}